import { combineReducers } from "redux";

import authReducer from "./auth/authReducer.js";
import blogReducer from "./blog/blogReducer.js";
import profileReducer from "./profile/profileReducer.js";
import skillReducer from "./skill/skillReducer.js";
import workReducer from "./work/workReducer.js";

export const reducers = combineReducers({
  work: workReducer,
  work: workReducer,
  work: workReducer,
  work: workReducer,
  work: workReducer,
});
